import React from "react";
import { useSelector, useDispatch } from 'react-redux';
import './Refresh.css';

function Refresh() {
    const dispatch = useDispatch();

    const isRestart = useSelector((state) => state.isRestart);
    const isNamePage = useSelector((state) => state.isNamePage);

    // dispatch({ type: 'CHANGE_LETTERDATA', data: [] });

    return (
        <React.Fragment>
            <div className="mult2rect mult2rect1"></div>
            <div className="mult2rect mult2rect2"></div>
            <div className="mult2rect mult2rect3"></div>
            <div className="mult2rect mult2rect4"></div>
            <div className="mult2rect mult2rect5"></div>
        </React.Fragment>
    );
};

export default Refresh;
